version = __version__ = '1.2'





def main():
    sg.set_options(icon=icon())

    layout = [[sg.Image(icon()), sg.T('UglySoup...PySimpleSoft Application', font='_ 30')],
              [sg.B('Go'), sg.B('Exit')]]


    window = sg.Window('Ugly', layout, right_click_menu=sg.MENU_RIGHT_CLICK_EDITME_VER_EXIT, enable_close_attempted_event=True, finalize=True)

    while True:
        event, values = window.read()
        print(event, values)
        if event in (sg.WIN_CLOSED, sg.WIN_CLOSE_ATTEMPTED_EVENT, 'Exit'):
            break
    window.close()


def main_entry_point():

    sg.set_global_icon(icon())
    main()

def icon():
    return \
        b''

if __name__ == '__main__':
    main_entry_point()
